import React from "react";
import { Form, Navbar } from "react-bootstrap";

const Customer = () => {
  return (
    <div>
      <Navbar style={{ height: "4rem" }} className="bg-light"></Navbar>
      <div className="row">
        <div
          className="col-md-3 bg-light align-middle offset-1"
          style={{ height: "100vh" }}
        >
          <button style={{ border: "none", background: "none" }}>Order</button>{" "}
          <br />
          <button style={{ border: "none", background: "none" }}>
            Service lits
          </button>{" "}
          <br />
          <button style={{ border: "none", background: "none" }}>
            Review
          </button>{" "}
          <br />
        </div>
        <div style={{backgroundColor:"#4fba80"}} className="col-md-9 bg-smoke-white">
          <Form.Control
            style={{ height: "70px" }}
            type="text"
            placeholder="Your Email address"
          />
        </div>
      </div>
    </div>
  );
};

export default Customer;
